import './Experience.css';

function Experience() {
  const renderCard = (date, text) => {
    return (
      <div className='timeline-card'>
        <div className='timeline-card-bullet timeline-element-grid'>
          <div className='timeline-icon'>
            <div className='timeline-circle'/>
          </div>
          <div className='timeline-date'>
            {date}
          </div>
        </div>
        <div className='timeline-card-info timeline-element-grid'>
          <div className='timeline-icon'>
            <div className='timeline-line'/>
          </div>
          <div className='timeline-info'>
            <p>TEXT</p>
          </div>
        </div>
    </div>
    );
  }
  return (
    <section id='experience-section' className='full-cover'>
      <div id='timeline'>
        {renderCard('September 2016 - July December 2020', 'TEXT')}
      </div>
    </section>
  )
}

export default Experience;
